import React from 'react';
import { Link } from 'react-router-dom';
import Logo from './images/booksandbrewskies/logo.png';
const Header = () => {
  return (
    <nav className="site-header sticky-top py-1" style={{backgroundColor: "rgba(0, 0, 0, .85)"}}>
  <div className="container d-flex flex-column flex-md-row justify-content-between" style={{maxWidth: "960px"}}>
    <a className="py-2" href="#" aria-label="Product">
      <img src={Logo} alt="logo" height="50px" width="50px" />
    </a>
    <Link to="/" className="py-2 d-none d-md-inline-block mt-4" href="#">Home</Link>
    <Link to="/shop" className="py-2 d-none d-md-inline-block" href="#">Shop</Link>
    <Link to="/shop/checkout" className="py-2 d-none d-md-inline-block" href="#">Checkout</Link>
    <Link to="/team" className="py-2 d-none d-md-inline-block" href="#">Team</Link>
    <Link to="/contact" className="py-2 d-none d-md-inline-block" href="#">Contact</Link>
    <div className="social-icons mt-2">
    <img className="rounded mr-1" height="20px" width="20px" src="https://upload.wikimedia.org/wikipedia/commons/thumb/7/71/Spotify.png/600px-Spotify.png" alt="..." />
    <img className="rounded mr-1" height="20px" width="20px" src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Podcasts_%28iOS%29.svg/256px-Podcasts_%28iOS%29.svg.png" alt="..." />
    <img className="rounded mr-1" height="20px" width="20px" src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/96/YouTube_social_red_squircle_%282017%29.svg/1024px-YouTube_social_red_squircle_%282017%29.svg.png" alt="..." />
    <img className="rounded mr-1" height="20px" width="20px" src="https://pbs.twimg.com/profile_images/966666153929125888/pwVzLi75_400x400.jpg" alt="..." />
    </div>
  </div>
</nav>
  )
}

export default Header;
